import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import { Link } from 'react-router-dom';

const Navbar: React.FC = () => {
  return (
    <AppBar
      position="fixed"
      sx={{
        background: 'rgba(0, 0, 0, 0.7)',
        backdropFilter: 'blur(10px)',
        boxShadow: 'none',
        borderBottom: '1px solid rgba(255, 255, 255, 0.2)',
      }}
    >
      <Toolbar>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1, color: '#9c27b0' }}>
          Portfolio
        </Typography>
        <Box>
          <Button color="inherit" component={Link} to="/home" sx={{ color: '#e1bee7', '&:hover': { color: '#9c27b0' } }}>Home</Button>
          <Button color="inherit" component={Link} to="/projects" sx={{ color: '#e1bee7', '&:hover': { color: '#9c27b0' } }}>Projects</Button>
          <Button color="inherit" component={Link} to="/profile" sx={{ color: '#e1bee7', '&:hover': { color: '#9c27b0' } }}>Profile</Button>
          <Button color="inherit" component={Link} to="/blog" sx={{ color: '#e1bee7', '&:hover': { color: '#9c27b0' } }}>Blog</Button>
          <Button color="inherit" component={Link} to="/contact" sx={{ color: '#e1bee7', '&:hover': { color: '#9c27b0' } }}>Contact Me</Button>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
